import React from 'react';
import './RecValue.css';


const RecValue = props => {
    function renderData() {
        return props.concepts.map(item =>
            <div key={item.id}>
            <table>
            <tr>
                
            <td>{item.name}</td>
            <td>{item.value} </td>
            
            </tr>
            </table>
            </div>
            )
    }
        return (
            
            <div>{renderData()}</div>
            
        )
    }


export default RecValue;
